    n, k = map(int, data[0].split())
    s = data[1].strip()

    count = 0
    start = 0

    while start < len(s):
        if s[start] == 'O':
            # Count consecutive 'O's starting at start
            end = start + 1
            while end < len(s) and s[end] == 'O':
                end += 1

            # Check if we have enough consecutive 'O's to form a group of size k
            if end - start >= k:
                count += 1
                start = end
            else:
                start = end
        else:
            start += 1

    print(count)

