def main():
    s = input().strip()
    n = len(s)

    # Check if length is even
    if n % 2 != 0:
        print("No")
        return

    half = n // 2

    # Count frequency of each character
    freq = {}
    for char in s:
        freq[char] = freq.get(char, 0) + 1

    # Check if all frequencies are either 0 or 2
    valid = True
    for count in freq.values():
        if count != 0 and count != 2:
            valid = False
            break

    if not valid:
        print("No")
        return

    # Check if all pairs have same frequency
    pair_freq = {}
    for i in range(half):
        pair = (s[i], s[2*i])
        pair_freq[pair] = pair_freq.get(pair, 0) + 1

    for count in pair_freq.values():
        if count != 2:
            print("No")
            return

    print("Yes")

